INSERT INTO `news` VALUES (98, 1, 0, 0, '车配龙真正打造能够净化市场的中国汽配电商第一网', '', '', '', '', '<p style=\\\"text-align:center\\\"><strong><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 22px\\\"><span style=\\\"font-family:宋体\\\">这里有全车件，还有透明的价格</span></span></strong></p><p style=\\\"text-align:center\\\"><strong><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 22px\\\"><span style=\\\"font-family:宋体\\\">车配龙真正打造能够净化市场的中国汽配电商第一网</span></span></strong></p><p style=\\\"line-height: 120%; text-align: right;\\\"><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">——</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">专访上海燎申（集团）有限公司副总裁、上海车配龙（股份）有限公司董事总经理史中</span></span></p><p style=\\\"text-align:center;line-height:120%\\\"><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">本报记者　黄霞</span></span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">汽配城要转型，这是每一位</span><span style=\\\"font-family:宋体\\\">老汽配人</span><span style=\\\"font-family:宋体\\\">心知肚明的事，因为他们都在经受搬迁、销售模式改变、互联网冲击带来的影响。最让记者感叹的莫过于，</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">2015</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年有着悠久历史的京城西效汽配城搬迁了，很多老汽配人就此改行。与此同时，汽配电子商城兴起，各路资本蜂拥而至，京东、淘宝等打造的汽配商城已名声在外，传统汽车零部件企业、海外电商、汽车后市场达人、甚至整车企业都在积极搭建汽配件的网上销售平台。但是，目前我国没有一家汽车网上商城能够做到真正直击痛点净化汽车后市场环境。</span></span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">在</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">2017</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年上海车展期间，记者了解到上海汽车配件圈的</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">一枝独秀</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”——</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">上海车配龙</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">(</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">股份</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">)</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">有限公司（简称</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">车配龙</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">）网上商城要改变行业现状。那么，车配龙网上商城能否融合传统优势与互联网思维？它能承载净化汽车后市场环境的重任吗？带着一系列的疑问甚至是期望，记者于车展期间专访了上海燎申（集团）有限公司副总裁、上海车配龙（股份）有限公司董事总经理史中。</span></span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">&nbsp;</span></p><p style=\\\"text-indent:28px\\\"><strong><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">主动与资本对接　车配龙上新三板了</span></span></strong></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">这是为数不多的传统汽配城主动出击打造网上商城的案例，正因此，车配龙于去年</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">4</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">月在新三板上挂牌上市。</span></span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">我们要把车配龙打造成中国汽车后服务市场的</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">’</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">第一股</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">’</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">史中说的这席话十分提士气。据悉，车配龙成立于</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">2008</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年，由原吴中汽配城演变发展而来，目前是上海规模最大的汽配交易市场之一。他对记者说：</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">目前车配龙占地</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">150</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">亩，年交易额达到</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">40</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">亿元，年创税</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">2</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">亿元以上，目前车配龙</span></span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">市场</span></span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">拥有超过</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">1200</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">家商户，业务包括汽配件、汽车美容、改装</span></span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">、配送物流</span></span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">等。</span><span style=\\\"font-family:宋体\\\">年营收达百亿元的上海燎申（集团）有限公司</span><span style=\\\"font-family:宋体\\\">是车配龙的大股东。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">车配龙拥有一定实力、且主动与资本市场对接，还在合适的时间里积极融入互联网思维，加快实施</span></span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">以汽车后服务</span>+互联网+集仓为主体，汽车文化为补充的战略转型</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">。史中对记者说：</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“2015</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年，我们就在思考汽车后市场的变革之路。当时我们已经感觉到传统汽配城会受到电商极大的冲击。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">随后，他介绍了车配龙迎接时代变革的一些大动作。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">除了挂牌新三板外，我们在</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">2014</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">9</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">月于四川遂宁拓展成立车配龙国际汽车百货广场，于</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">2015</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">12</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">月在上海七宝地区成立</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">’</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">车配龙生活欢乐港</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">’</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">，于</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">2016</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">6</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">月并购中华汽配网建立互联网事业部，于该年</span></span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\">8月又合资组建了车配龙聚配行一站式汽配销售服务平台</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">他告诉记者，目的只有一个，</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:Calibri\\\">即</span></span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">利用整合好车配龙强大的线下资源，插上互联网的翅膀打通融合线下线上力争成为汽配第一网</span></span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">。</span></span></p><p><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">&nbsp;</span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">&nbsp;</span></p><p style=\\\"text-indent:28px\\\"><strong><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">要做全车件销售　车配龙立定志向</span></span></strong></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">2016</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">10</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">月，车配龙网上商城正式上线。</span></span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">尽管才过去短短几个月的时间，车配龙网上商城的营销模式受到华东地区甚至全国汽修厂的认可。据悉，目前车配龙网上商城月销售额超过</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">2000</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">万元，且呈正极增长。史中希望，该商城年销售额能够达到</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">3</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">亿元。他还让记者体验了一下同步上线车配龙</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">APP</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">的便利性。目前该</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">APP</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">揽括了</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">30</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">多个主流品牌大众配件。此外，车配龙正在筹划建立同质配件的示范点。</span></span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">车配龙网上商城立定志向要做全车件。史中对记者说：</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">燎申集团正在举集团之力重点打造。我们计划在</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">3</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年内完成华东地区的市场布局，争取在</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">5</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年的时间内打造成中国汽车后服务市场第一网。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">最为关键的是，这是一个最好的时代。未来</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">5</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">年内，我国汽车后市场新格局将会形成。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">成功了，那将是万亿规模级的市场。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">行业资深人士表示。</span></span></p><p><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">　　史中强调，车配龙找到了汽车后市场的痛点，也能够做到</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">对症下药</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">。他说：</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">目前汽车后市场尤其是汽修市场存在配件价格高、市场不透明、送货慢、配件质量没有保障等问题。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">对此，车配龙</span></span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">集仓</span>+互联网模式</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">秉持</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">不售假、不暴利、不回扣</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">经营理念，实行形象统一，仓储统一，营销统一，配送统一，结算统一，服务统一的市场同步措施，建立质量问题先行赔付和</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">暴利投诉</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">管理机制，并引入第三方金融合作单位解决合作方资金瓶颈，立志打造汽车维修企业真心信任和依赖的汽车全车件一站式销售服务平台。他还表示，</span></span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">以车配龙聚配行平台为主体的上海市汽车维修协会配件工委会已经成立，这意味着上海市维修协会非常愿意与车配龙密切合作。目前我们已于上海</span>800多家维修协会会员单位签订合作协议，预计首批年采购量可达5亿元</span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:Calibri\\\">。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">史中说道。</span></span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">我们希望在汽配行业打造一个真正的</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">“</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">奥特莱斯</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">，以点带面地净化环境。</span></span><span style=\\\"font-family: Calibri;letter-spacing: 0;font-size: 14px\\\">”</span><span style=\\\"font-family: 宋体;letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">史中也坦言道，再宏伟的蓝图，不仅需要企业脚踏实地步步推进，也需要一个培育和整合过程，更需要资本等各方的支持。</span></span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: 宋体;color: rgb(255, 0, 0);letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">回首车配龙深耕于中国汽车后市场的历史，敢为人先，勇于拼搏，以超前的服务意识，为客户带来最优化的体验，是车配龙发展壮大和走向成功的坚定原则。</span></span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: 宋体;color: rgb(255, 0, 0);letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">在中国汽车后市场的改革发展中，</span></span><span style=\\\"font-family: 宋体;color: rgb(254, 37, 0);letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">车配龙</span></span><span style=\\\"font-family: 宋体;color: rgb(253, 37, 0);letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">抓住市场机遇</span></span><span style=\\\"font-family: 宋体;color: rgb(255, 0, 0);letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">，</span></span><span style=\\\"font-family: 宋体;color: rgb(254, 40, 80);letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">适时</span></span><span style=\\\"font-family: 宋体;color: rgb(255, 0, 0);letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">推出车配龙互联网</span></span><span style=\\\"font-family: Calibri;color: rgb(255, 0, 0);letter-spacing: 0;font-size: 14px\\\">+</span><span style=\\\"font-family: 宋体;color: rgb(255, 0, 0);letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">集仓模式，正是车配龙不汲于既往的成就，不坐困愁城，誓做披荆斩棘的开拓者的担当。</span></span></p><p style=\\\"text-indent:28px\\\"><span style=\\\"font-family: 宋体;color: rgb(255, 0, 0);letter-spacing: 0;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">车配龙将以加倍的努力，在未来的发展道路上，以超前的危机意识，响应国家产业政策，引领行业风潮，在蕴藏无限商机的中国汽车后市场开辟出一片新天地，为中国汽车后市场的蓬勃发展贡献自己的力量。</span></span></p><p><br/></p>', 0, 1, 1, 0, '', 0, '', 0, 1497426232, 1497426232, 0);
INSERT INTO `news` VALUES (99, 1, 0, 0, '打造全新汽配供应链——“车配龙”强势崛起', '', '', '', '', '<p style=\\\"text-indent:0;text-align:center\\\"><br/></p><p style=\\\"text-indent:36px\\\"><span style=\\\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\"><span style=\\\"font-family: 宋体; font-size: 16px;\\\">车配龙是中国最早一批运营汽车后服务专业市场的公司，现有营业面积逾</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">10</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">万平方米，年交易额过百亿元，旨在立足上海，辐射全球，并于</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">2016</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">年</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">4</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">月</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">22</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">日成功登陆新三板，正式在全国中小企业股份转让系统挂牌公开转让（证券代码：</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">837183</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">），对接资本市场，开启全新的发展格局！</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">&nbsp;</span></span></p><p style=\\\"text-indent:0;text-align:center\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170614/1497429532465993.png\\\" title=\\\"1497429532465993.png\\\"/><span style=\\\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\"><strong><span style=\\\"font-family: Calibri; font-size: 20px;\\\">&nbsp;</span></strong><strong><span style=\\\"font-family: Calibri; font-size: 20px;\\\"></span></strong></span></p><p style=\\\"text-indent:36px\\\"><span style=\\\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\"><span style=\\\"font-family: 宋体; font-size: 16px;\\\"><span style=\\\"font-family: 宋体;\\\">回首车配龙十余年的发展壮大历程便会发现，作为汽车独立售后市场重要流通环节的</span>“汽配经销实体”，长期以来的现状是规模小、不规范、太分散，这些痛点成为业内的诟病，并束缚着整个汽车售后市场的发展。尽管多年来，外资以各种模式进入中国汽车售后市场，如</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">NAPA</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\"><span style=\\\"font-family: 宋体;\\\">的两进两出，花旗集团的大手笔资本运作，司库伯的努力坚守等，但这些</span>“巨头”们终因各种原因而退出中国市场。现实表明，靠“外力”无法“解救”中国汽车独立售后市场，人们又将希望寄托于中国本土市场能够尽早出现具规模、跨区域、规范经营的企业。而在这十多年的发展过程中，中国汽车独立售后市场的一颗新秀</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">——</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">“车配龙”，正在崛起！车配龙一直坚定信念，顺应时代发展和国家产业政策的调整，实施革新发展战略，</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">2016</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">年</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">9</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\"><span style=\\\"font-family: 宋体;\\\">月份，车配龙</span>·聚配行这个“一站式汽车配件销售服务平台”正式成立，标志着汽配经销实体长期以来规模小、不规范、太分散的现状正在被打破，“</span><strong><span style=\\\"font-family: 宋体; font-size: 16px;\\\"><span style=\\\"font-family: 宋体;\\\">统一报价、统一仓储、统一物流、统一配送、统一服务、统一运营</span>”的新模式正式建立。</span></strong><strong><span style=\\\"font-family: 宋体; font-size: 16px;\\\"></span></strong></span></p><p style=\\\"text-indent:0;text-align:center\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170614/1497429544498099.png\\\" title=\\\"1497429544498099.png\\\"/><span style=\\\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\">&nbsp;</span></p><p style=\\\"text-indent:0;text-align:center\\\"><span style=\\\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\">&nbsp;</span></p><p style=\\\"text-indent:36px\\\"><span style=\\\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\"><span style=\\\"font-family: 宋体; font-size: 16px;\\\">中国互联网的发展正以日新月异的速度冲击着每一个行业，而且不断改变着人们的消费方式，经常有一些媒体、同行甚至一些投资人在各种场合把汽车后市场的服务分成各种类型，并给企业贴上互联网、电商、连锁、传统等等标签，而真正重要的是，从事我们这个行业才知道汽车后市场有着其自身的特殊性、专业性，互联网与汽车后市场如何做到真正的结合，一直是我们车配龙在研究的课题，需要我们不断的更新自身的知识结构、产业布局，</span><strong><span style=\\\"font-family: 宋体; font-size: 16px;\\\">真正做大配件连锁与维修连锁系统之间的互通，提供快速简单的报价、仓储、物料、配送、服务、运营方式。</span></strong><strong><span style=\\\"font-family: 宋体; font-size: 16px;\\\"></span></strong></span></p><p style=\\\"text-indent: 36px; text-align: center;\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170614/1497429557572099.jpg\\\" title=\\\"1497429557572099.jpg\\\"/><span style=\\\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\">&nbsp;</span></p><p style=\\\"text-indent:36px\\\"><span style=\\\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\"><span style=\\\"font-family: 宋体; font-size: 16px;\\\">历经多年的研究与积累，</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">&nbsp;2016</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">年</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">9</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\"><span style=\\\"font-family: 宋体;\\\">月份在车配龙</span>·聚配行集仓项目启动的同时，车配龙</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">APP</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">、车配龙网上商城同步正式上线，正是一种超前的危机意识的和进取雄心的体现。车配龙</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">APP</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\"><span style=\\\"font-family: 宋体;\\\">的上线极大的方便了客户的询价、报价、采购、物流、配送、服务、管理，打造了粘合度更高的新型顾客关系网络。一站式销售服务平台聚配行的建立和</span>“互联网</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">+</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">”的运用，对于汽车后市场的标杆意义不言而喻，这也将是车配龙未来持续发展的大方向，以及在汽车后市场发展中的主要推广模式。效率的提高、采购成本的降低是效益增长的前提，也是走品牌化可持续发展的必然趋势。“集仓</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">+</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\"><span style=\\\"font-family: 宋体;\\\">互联网</span>”的模式将实现共享客户资源，深挖市场，不断拓展市场前沿，扩大市场占有率。</span></span></p><p style=\\\"text-indent:0;text-align:center\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170614/1497429577888702.png\\\" title=\\\"1497429577888702.png\\\"/><span style=\\\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\">&nbsp;</span></p><p style=\\\"text-indent:16px;text-align:center\\\"><span style=\\\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\">&nbsp;</span></p><p style=\\\"text-indent:36px\\\"><span style=\\\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\"><span style=\\\"font-family: 宋体; font-size: 16px;\\\"><span style=\\\"font-family: 宋体;\\\">时不我待，时不我与，一个企业在市场激烈的竞争中如逆水行舟，不进则退，对于一个企业来说，固守本分，虽然可以稳扎稳打于一时，但是对于日新月异的市场和不断调整的商业模式来说，迟早将被淘汰。机会不仅仅是给有准备的人，也是给每一个勇敢抓住机会，拥有前瞻思维的人准备的。车配龙</span>·聚配行集仓项目的启动、车配龙</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">APP</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">、车配龙网上商城的正式上线，并不是车配龙发展的终点，只是车配龙未来发展一个新的起点。</span></span></p><p style=\\\"text-indent:36px\\\"><span style=\\\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\"><span style=\\\"font-family: 宋体; font-size: 16px;\\\"><span style=\\\"font-family: 宋体;\\\">在资本不断涌入的当下，这一日益增长而且蓬勃发展的行业充满了激烈的竞争，也体现在</span>“互联网</span><span style=\\\"font-family: Calibri; font-size: 16px;\\\">+</span><span style=\\\"font-family: 宋体; font-size: 16px;\\\">”的影响。相比传统经济时代，互联网深刻改变消费模式和影响人们消费观念的同时，也将一个企业呈现几何倍数的增长变得更加迅速，变得不可思议，这就是互联网加资本的力量。车配龙登陆新三板，助力我们打开资本市场的大门，在分享可喜成果的同时，我们也应理智的意识到，我们正处汽车后市场剧烈变革的前沿和风潮之中。抓住时代发展脉搏，脚踏实地，以实体企业的稳健，加上互联网的效率和速度，必定会让车配龙深耕十余年的汽车后市场之路走得更加风生水起，通天大道既宽且阔。</span></span></p><p style=\\\"text-indent:0;text-align:center\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170614/1497429588511398.png\\\" title=\\\"1497429588511398.png\\\"/><span style=\\\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\">&nbsp;</span></p><p style=\\\"text-indent:0;text-align:center\\\"><span style=\\\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\">&nbsp;</span></p><p style=\\\"text-indent:36px\\\"><span style=\\\"font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\"><span style=\\\"font-family: 宋体; font-size: 16px;\\\">千帆竞争，百舸争流，拥有万亿元的中国汽车后市场，每天都在出现各种新的商业模式，新的企业层出不穷。只有不满足于现状，勇敢攀登高峰，锐意进取，不汲汲于小成就的自足，才能登上泰山的高顶，享受一览众山小的壮丽美景。中国汽车保有量的不断增长，连续多年来保持世界产销量第一的大趋势，决定了中国汽车后服务市场的不断壮大，这就需要一批品牌化战略企业满足市场需求、引导市场健康发展。</span><strong><span style=\\\"font-family: 宋体; font-size: 16px;\\\">“车配龙</span></strong><strong><span style=\\\"font-family: Calibri; font-size: 16px;\\\">+</span></strong><strong><span style=\\\"font-family: 宋体; font-size: 16px;\\\">互联网</span></strong><strong><span style=\\\"font-family: Calibri; font-size: 16px;\\\">+</span></strong><strong><span style=\\\"font-family: 宋体; font-size: 16px;\\\"><span style=\\\"font-family: 宋体;\\\">集仓</span>”的建立，使得我们抓住这一战略机遇，使得汽车后服务市场市值百亿的品牌化巨无霸型战略企业成为车配龙的未来。</span></strong><strong><span style=\\\"font-family: 宋体; font-size: 16px;\\\"></span></strong></span></p><p style=\\\"text-indent:0;text-align:center\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170614/1497429598789934.png\\\" title=\\\"1497429598789934.png\\\"/><span style=\\\"font-size: 16px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;\\\">&nbsp;</span></p><p><br/></p>', 0, 1, 0, 1, '', 0, '', 0, 1497429607, 1497429607, 0);
INSERT INTO `news` VALUES (100, 1, 0, 0, '网上商城登陆公告', '', '', '', '', '<p style=\\\"text-indent:48px\\\"><span style=\\\"font-family: 微软雅黑; font-size: 16px;\\\">车配龙商城将于2017年<span style=\\\"font-family: Tahoma;\\\">6</span>月<span style=\\\"font-family: Tahoma;\\\">28</span>日全新登陆汽车后市场，车配龙商城包括商城平台和自营板块。</span></p><p style=\\\"text-indent:48px\\\"><span style=\\\"font-family: 微软雅黑; font-size: 16px;\\\">凡是于2017年<span style=\\\"font-size: 16px; font-family: Tahoma;\\\">7</span>月<span style=\\\"font-size: 16px; font-family: Tahoma;\\\">15</span>日之前在车配龙商城平台开店的商户，免费拍照，免费整理上传资料，免费指导开店！</span></p><p style=\\\"text-indent:48px\\\"><span style=\\\"font-family: 微软雅黑; font-size: 16px;\\\">免免免，优惠多多，方便多多，机会难得，过期不候！</span></p><p style=\\\"text-indent:48px\\\"><span style=\\\"font-family: 微软雅黑; font-size: 16px;\\\">车配龙商城将与您一起撬动万亿汽车后市场的无限商机，我们也将以立高望远的姿态，全力打造汽车后市场的“京东”！</span></p><p><br/></p>', 0, 1, 1, 0, '', 0, '', 0, 1497429744, 1497429744, 0);
INSERT INTO `news` VALUES (101, 1, 0, 0, '车配龙股份战略布局新闻发布会暨新三板挂牌一周年庆典隆重举行', '', '', '', '', '<p style=\\\"text-indent: 28px; text-align: center;\\\"><strong><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170630/1498784604271605.png\\\" title=\\\"1498784604271605.png\\\"/></strong></p><p style=\\\"text-indent:28px\\\"><strong><span style=\\\";font-family:宋体;font-size:14px\\\">2017<span style=\\\"font-family:宋体\\\">年</span><span style=\\\"font-family:Calibri\\\">6</span><span style=\\\"font-family:宋体\\\">月</span><span style=\\\"font-family:Calibri\\\">28</span><span style=\\\"font-family:宋体\\\">日，车配龙股份（</span><span style=\\\"font-family:Calibri\\\">837183</span><span style=\\\"font-family:宋体\\\">）战略布局新闻发布会暨新三板挂牌一周年庆典在上海外滩</span><span style=\\\"font-family:Calibri\\\">SOHO</span><span style=\\\"font-family:宋体\\\">广场举行。来自</span></span><span style=\\\"font-family: 宋体;font-size: 14px;background: rgb(255, 255, 255)\\\"><span style=\\\"font-family:宋体\\\">政府有关领导、行业协会领导专家、各大券商律所、投资机构、新闻媒体、股东代表、车配龙股份董事长林先燎（</span></span></strong><span style=\\\"font-family: 宋体;font-size: 14px;background: rgb(255, 255, 255)\\\"><span style=\\\"font-family:宋体\\\">创始人）及高管团队相聚一堂，共同见证车配龙高速发展的历史性时刻。</span></span></p><p style=\\\"text-indent: 28px; text-align: center;\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170630/1498784617787172.png\\\" title=\\\"1498784617787172.png\\\"/><span style=\\\";font-family:Calibri;font-size:14px\\\">&nbsp;</span></p><p style=\\\"text-indent:28px\\\"><span style=\\\";font-family:宋体;font-size:14px\\\"><span style=\\\"font-family:宋体\\\">董事长林先燎首先向所有来宾做了热情洋溢的欢迎词，表示车配龙股份扎根于汽车后服务市场十六载，已发展成为汽车后服务市场的标杆企业之一。</span>2016<span style=\\\"font-family:宋体\\\">年</span><span style=\\\"font-family:Calibri\\\">6</span><span style=\\\"font-family:宋体\\\">月，车配龙股份高管团队在全国股转系统敲响了新三板开市宝钟，并将新三板挂牌作为发展新起点。一年来，公司启动转型发展，内抓管理提升、对外投资并购，探索企业发展方向、规划公司战略目标。完成收购互联网企业</span></span><span style=\\\";font-family:Calibri;font-size:14px\\\">—</span><span style=\\\";font-family:宋体;font-size:14px\\\"><span style=\\\"font-family:宋体\\\">上海创宇信息技术发展有限公司（中华汽配网），实现了自主研发建设的汽配件网上商城</span>—车配龙<span style=\\\"font-family:Calibri\\\">APP</span><span style=\\\"font-family:宋体\\\">上线运营；投资设立上海车配龙聚配行贸易有限公司，建立一站式汽车配件销售服务平台。初步确立了“升级创新中的汽车后服务市场</span><span style=\\\"font-family:Calibri\\\">+</span><span style=\\\"font-family:宋体\\\">互联网</span><span style=\\\"font-family:Calibri\\\">+</span><span style=\\\"font-family:宋体\\\">一站式汽配销售平台”的崭新商业模式，树立了争创“汽车后服务第一股”和“汽车后服务第一网”的宏伟目标。</span></span></p><p><strong><span style=\\\"font-family: 宋体;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">车配龙融资路演</span></span></strong></p><p style=\\\"text-indent:28px\\\"><span style=\\\";font-family:宋体;font-size:14px\\\"><span style=\\\"font-family:宋体\\\">车配龙常务副总经理陈屹先生从行业发展趋势、公司商业模式、发展规划、投资亮点和项目融资需求等角度向在座来宾做了全方位的详细介绍和汇报，吸引了各参会人员的关注和认同。长江证券、东开投资和海航物流集团分别上台进行发言点评，对公司的商业模式和发展前景表示高度赞同并表示出强烈的投资合作愿望。</span></span></p><p><strong><span style=\\\"font-family: 宋体;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">车配龙与海航投资签约</span></span></strong></p><p style=\\\"text-indent:28px\\\"><span style=\\\";font-family:宋体;font-size:14px\\\"><span style=\\\"font-family:宋体\\\">经过多次深入洽谈达成的意向，在本次发布会上车配龙董事长林先燎先生与海航物流集团汽车事业集群总裁黄高志先生分别代表双方签署了《战略合作协议》。海航物流集团表示，汽车后服务市场是近年来的投资风口，跟随资本嗅觉，海航一直在寻找有潜力、有实力的汽车后服务</span>+<span style=\\\"font-family:宋体\\\">互联网企业，我们惊喜的发现车配龙不但拥有上千家汽配件实体经销商的雄厚资源及十多年积淀的行业管理经验，而且具备互联网</span><span style=\\\"font-family:Calibri\\\">+</span><span style=\\\"font-family:宋体\\\">的创新思维。正是看到车配龙具备深厚的行业实力与未来发展的巨大潜力，在汽车后市场</span><span style=\\\"font-family:Calibri\\\">+</span><span style=\\\"font-family:宋体\\\">互联网的创业大军中我们选择与车配龙携手合作，共同撬动汽车后服务市场的万亿蓝海。</span></span></p><p style=\\\"text-align: center;\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170630/1498785226974478.png\\\" title=\\\"1498785226974478.png\\\" alt=\\\"合并1.png\\\"/></p><p><strong><span style=\\\"font-family: 宋体;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">战略发布：打造</span>“中国汽车后服务市场第一股”、“中国汽车后服务市场第一网”</span></strong></p><p style=\\\"text-indent:28px\\\"><span style=\\\";font-family:宋体;font-size:14px\\\"><span style=\\\"font-family:宋体\\\">车配龙董事、总经理史中先生以富有感染力的演讲发布了车配龙战略布局，车配龙以</span>“升级创新中的汽车后服务市场<span style=\\\"font-family:Calibri\\\">+</span><span style=\\\"font-family:宋体\\\">互联网</span><span style=\\\"font-family:Calibri\\\">+</span><span style=\\\"font-family:宋体\\\">一站式汽配销售平台”为商业模式，大力发展车配龙网上商城，通过线上引领线下，通过</span><span style=\\\"font-family:Calibri\\\">O2O</span><span style=\\\"font-family:宋体\\\">模式构筑一个汇聚汽配件生产厂家、经销商、维修企业及终端客户于一体的超级交易平台，打造具有“车配龙”自主品牌的同质汽配件，采用线下共管仓库和线上网络平台，并通过“总仓—干线物流—分仓—落地配送”的模式，汽配件销售平台辐射全国。同时向大家具体阐述了公司的</span><span style=\\\"font-family:Calibri\\\">5</span><span style=\\\"font-family:宋体\\\">年战略规划和企业战略目标及愿景，令人心潮澎湃、踌躇满志。</span></span></p><p style=\\\"text-indent: 28px; text-align: center;\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170630/1498784656625659.png\\\" title=\\\"1498784656625659.png\\\"/></p><p><strong><span style=\\\"font-family: 宋体;font-size: 14px\\\"><span style=\\\"font-family:宋体\\\">车配龙网（</span>www.chepeilong.com<span style=\\\"font-family:宋体\\\">）上线仪式</span></span></strong></p><p style=\\\"text-indent:28px\\\"><span style=\\\";font-family:宋体;font-size:14px\\\"><span style=\\\"font-family:宋体\\\">随着车配龙董事、总经理史中先生郑重按下启动键，历时一年研发和建设的车配龙网于今天正式开通上线。中华汽配网创始人、车配龙互联网中心总监王宇星先生演示了车配龙网上商城网页及车配龙</span>APP<span style=\\\"font-family:宋体\\\">的操作。车配龙网上商城的上线开创了汽车配件</span><span style=\\\"font-family:Calibri\\\">O2O</span><span style=\\\"font-family:宋体\\\">时代，依托强大的汽车配件数据系统支撑，辅以配件集仓，通过现代化的仓储管理体系实现快速调配，让普通消费者能够根据车型及配件型号便捷的找到相应配件并进行比价购买。这一平台的建立解决了汽车后市场车型信息匹配滞后与不对称这一困扰汽车后市场发展的瓶颈问题。可以预见，“买汽配上车配龙网”不久将成为现实。</span></span></p><p style=\\\"text-align: center;\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170630/1498785249767108.png\\\" title=\\\"1498785249767108.png\\\" alt=\\\"合并2.png\\\"/></p><p><strong><span style=\\\"font-family: 宋体;font-size: 14px\\\">&nbsp;“车配龙集团”揭牌仪式</span></strong></p><p style=\\\"text-indent:28px\\\"><span style=\\\";font-family:宋体;font-size:14px\\\"><span style=\\\"font-family:宋体\\\">中国汽车维修行业协会配件工作委员会主任王逢铃先生和闵行区委统战部副部长、区工商联党组书记孙耀辉先生对本次活动予以祝贺，对车配龙新三板挂牌一年的工作给予充分肯定，并提出了进一步的殷切期望。在车配龙董事长、总经理的陪同下，共同举杯为公司更名为</span>“上海车配龙实业（集团）股份有限公司”进行揭牌，把整个活动推向了高潮。车配龙集团的成立标志着车配龙朝“汽车后服务第一股”和“汽车后服务第一网”的宏伟目标又迈进一步，是车配龙创新发展的再亮剑，在传统汽车后市场时代，车配龙走在了前列，在未来汽车后市场的互联网<span style=\\\"font-family:Calibri\\\">+</span><span style=\\\"font-family:宋体\\\">风潮里，车配龙将继续秉承“引领市场、创新经营、和商共赢、拓展空间”的经营理念，以汽车后市场服务首席运营商的担当，以车配龙新商业模式为载体，把握汽车后服务市场万亿商机，成为国内具有竞争力和影响力的汽车后服务行业巨擎。</span></span></p><p style=\\\"text-align: center;\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170630/1498784685629038.png\\\" title=\\\"1498784685629038.png\\\"/></p><p style=\\\"text-align: center;\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170630/1498784695269399.png\\\" title=\\\"1498784695269399.png\\\"/></p><p style=\\\"text-align: center;\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170630/1498784705821208.png\\\" title=\\\"1498784705821208.png\\\"/></p><p><br/></p>', 0, 1, 0, 0, '', 0, '', 0, 1498784841, 1498784841, 1517817300);
INSERT INTO `news` VALUES (102, 1, 0, 0, '上海车配龙国际汽车售后服务市场经营管理股份有限公司关于公司名称变更的公告', '', '', '', '0', '<p style=\\\"margin-left:409px;text-align:right\\\"><strong><span style=\\\"font-family: 宋体;font-size: 16px\\\">公告编号：</span></strong><strong><span style=\\\"font-family: 仿宋;font-size: 16px\\\">2017-039</span></strong></p><p style=\\\"line-height:20px\\\"><span style=\\\";font-family:&#39;Times New Roman&#39;;font-size:16px\\\">&nbsp;</span></p><p style=\\\"text-align:center\\\"><strong><span style=\\\"font-family: 宋体;font-size: 16px\\\">证券代码：</span></strong><strong><span style=\\\"font-family: 仿宋;font-size: 16px\\\">837183</span></strong> <strong><span style=\\\"font-family: 宋体;font-size: 16px\\\">证券简称：车配龙</span></strong> <strong><span style=\\\"font-family: 宋体;font-size: 15px\\\"><span style=\\\"font-family:宋体\\\">主办券商：长江证券</span></span></strong></p><p style=\\\"white-space: normal; text-align: center;\\\"><strong><span style=\\\"font-family: 宋体; font-size: 24px;\\\">上海车配龙国际汽车售后服务</span></strong></p><p style=\\\"white-space: normal; text-align: center;\\\"><strong><span style=\\\"font-family: 宋体; font-size: 24px;\\\">市场经营管理股份有限公司</span></strong></p><p style=\\\"white-space: normal; text-align: center;\\\"><strong><span style=\\\"font-family: 宋体; font-size: 24px;\\\">关于公司名称变更的公告</span></strong></p><p style=\\\"white-space: normal; text-align: center;\\\"><strong><span style=\\\"font-family: 宋体; font-size: 24px;\\\"><img src=\\\"http://admin.chepeilong.com/uploads/resource/20170918/1505712888860896.png\\\" title=\\\"1505712888860896.png\\\" alt=\\\"声明.png\\\"/></span></strong></p><p style=\\\"white-space: normal;\\\"><strong><span style=\\\"font-family: 宋体; font-size: 19px;\\\"><br/></span></strong></p><p style=\\\"white-space: normal;\\\"><strong><span style=\\\"font-family: 宋体; font-size: 19px;\\\">一、基本情况</span></strong><br/></p><p style=\\\"white-space: normal; text-indent: 37px; line-height: 30.72px;\\\"><span style=\\\"font-family: 宋体; font-size: 18px;\\\">上海车配龙国际汽车售后服务市场经营管理股份有限公司（以下</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">简称“</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">公司”</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">）于 2017</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">&nbsp;年 7</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">&nbsp;月 10</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">&nbsp;日在公司会议室召开了 2017</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">&nbsp;年第四次临时股东大会，会议审议通过了《关于变更公司名称的议案》、《关于变更公司经营范围的议案》、《关于修改公司章程的议案》，详见公司于<span style=\\\"font-family: 仿宋; font-size: 19px; text-align: justify; text-indent: 37px;\\\">&nbsp;</span></span><span style=\\\"text-align: justify; font-family: 仿宋; font-size: 19px;\\\">2017<span style=\\\"font-family: 仿宋; font-size: 19px; text-align: justify; text-indent: 37px;\\\">&nbsp;</span></span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">年<span style=\\\"font-family: 仿宋; font-size: 19px; text-align: justify; text-indent: 37px;\\\">&nbsp;</span></span><span style=\\\"text-align: justify; font-family: 仿宋; font-size: 19px;\\\">7&nbsp;</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">月<span style=\\\"font-family: 仿宋; font-size: 19px; text-align: justify; text-indent: 37px;\\\">&nbsp;</span></span><span style=\\\"text-align: justify; font-family: 仿宋; font-size: 19px;\\\">11</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\"><span style=\\\"font-family: 仿宋; font-size: 19px; text-align: justify; text-indent: 37px;\\\">&nbsp;</span>日在全国中小企业股份转让系统指定的信息披露平台</span><span style=\\\"text-align: justify; font-family: 仿宋; font-size: 19px;\\\">(http://www.neeq.com.cn )</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">披露的《上海车配龙国际汽车售后服务市场经营管理股份有限公司<span style=\\\"font-size: 19px; text-align: justify; text-indent: 37px; font-family: 仿宋;\\\">&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\"></span></span><span style=\\\"text-align: justify; font-family: 仿宋; font-size: 19px;\\\">2017<span style=\\\"font-size: 19px; text-align: justify; text-indent: 37px; font-family: 仿宋;\\\">&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\"></span></span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">年第四次临时股东大会决议公告》（公告编号：</span><span style=\\\"text-align: justify; font-family: 仿宋; font-size: 19px;\\\">2017-037</span><span style=\\\"text-align: justify; font-family: 宋体; font-size: 19px;\\\">）。</span></p><p style=\\\"white-space: normal; line-height: 4px;\\\"><span style=\\\"font-family: &quot;Times New Roman&quot;;\\\">&nbsp;</span></p><p style=\\\"white-space: normal; text-indent: 37px; line-height: 30.72px;\\\"><span style=\\\"font-family: 宋体; font-size: 18px;\\\">公司已于近日完成了公司名称变更、经营范围变更及章程修正案的工商备案手续，并取得了上海市工商行政管理局换发的新营业执照。</span></p><p style=\\\"white-space: normal; line-height: 4px;\\\"><span style=\\\"font-family: &quot;Times New Roman&quot;;\\\">&nbsp;</span></p><p style=\\\"margin-right: 17px; white-space: normal; text-indent: 37px; text-align: justify; line-height: 29.12px;\\\"><span style=\\\"font-family: 宋体; font-size: 18px;\\\">公司已向全国中小企业股份转让系统有限责任公司履行完名称变更的备案手续，自<span style=\\\"font-size: 19px; text-align: justify; text-indent: 37px; font-family: 仿宋;\\\">&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\"></span></span><span style=\\\"font-family: 仿宋; font-size: 18px;\\\">2017</span><span style=\\\"font-family: 宋体; font-size: 18px;\\\"><span style=\\\"font-size: 19px; text-align: justify; text-indent: 37px; font-family: 仿宋;\\\">&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\"></span>年<span style=\\\"font-size: 19px; text-align: justify; text-indent: 37px; font-family: 仿宋;\\\">&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\"></span></span><span style=\\\"font-family: 仿宋; font-size: 18px;\\\">8</span><span style=\\\"font-family: 宋体; font-size: 18px;\\\"><span style=\\\"font-size: 19px; text-align: justify; text-indent: 37px; font-family: 仿宋;\\\">&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\"></span>月<span style=\\\"font-size: 19px; text-align: justify; text-indent: 37px; font-family: 仿宋;\\\">&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\"></span></span><span style=\\\"font-family: 仿宋; font-size: 18px;\\\">2</span><span style=\\\"font-family: 宋体; font-size: 18px;\\\"><span style=\\\"font-size: 19px; text-align: justify; text-indent: 37px; font-family: 仿宋;\\\">&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\"></span>日起，公司正式在全国中小企业股份转让系统进行名称变更。公司中文名称由</span><span style=\\\"font-family: Arial; font-size: 18px;\\\">“</span><span style=\\\"font-family: 宋体; font-size: 18px;\\\">上海车配龙国际汽车</span><span style=\\\"font-family: 宋体; font-size: 19px;\\\">售后服务市场经营管理股份有限公司</span><span style=\\\"font-family: Arial; font-size: 19px;\\\">”</span><span style=\\\"font-family: 宋体; font-size: 19px;\\\">变更为</span><span style=\\\"font-family: Arial; font-size: 19px;\\\">“</span><span style=\\\"font-family: 宋体; font-size: 19px;\\\">上海车配龙实业（集</span><span style=\\\"font-family: 宋体; font-size: 19px;\\\">团） 股 份 有 限 公 司&nbsp;</span><span style=\\\"font-family: Arial; font-size: 19px;\\\">”</span><span style=\\\"font-family: 宋体; font-size: 19px;\\\">， 英 文 名 称 由“</span><span style=\\\"font-family: 仿宋; font-size: 19px;\\\">Shanghai</span>&nbsp;<span style=\\\"font-family: 仿宋; font-size: 19px;\\\">Chepeilong&nbsp;</span><span style=\\\"font-family: 仿宋; font-size: 18px;\\\">International Automobile After-sales Service Market Operating&nbsp;</span><span style=\\\"font-family: 仿宋; font-size: 19px;\\\">and Management LTD<span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\">”</span></span><span style=\\\"font-family: 宋体; font-size: 19px;\\\">变更为<span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\">“</span></span><span style=\\\"font-family: 仿宋; font-size: 19px;\\\">Shanghai Chepeilong Industrial&nbsp;</span><span style=\\\"font-family: 仿宋; font-size: 19px;\\\">(Group) Co.,Ltd</span><span style=\\\"font-family: Arial; font-size: 19px;\\\"><span style=\\\"font-family: 宋体; font-size: 19px; text-align: justify; text-indent: 37px;\\\">”</span></span><span style=\\\"font-family: 宋体; font-size: 19px;\\\">，证券简称及证券代码保持不变。</span></p><p style=\\\"white-space: normal; line-height: 20px;\\\"><span style=\\\"font-family: &quot;Times New Roman&quot;;\\\">&nbsp;</span></p><p style=\\\"white-space: normal; line-height: 20px;\\\"><strong><span style=\\\"font-family: 宋体; font-size: 19px;\\\">二、备查文件</span></strong></p><p style=\\\"margin-right: 389px; margin-left: 37px; white-space: normal; line-height: 28.96px;\\\"><span style=\\\"font-family: 宋体; font-size: 19px;\\\">（一）《营业执照》特此公告。</span></p><p style=\\\"margin-right: 389px; margin-left: 37px; white-space: normal; line-height: 28.96px;\\\"><span style=\\\"font-family: 宋体; font-size: 19px;\\\"><br/></span></p><p style=\\\"margin-left: 501px; white-space: normal; line-height: 30.72px; text-align: right;\\\"><span style=\\\"font-family: 宋体; font-size: 18px;\\\"><br/></span></p><p style=\\\"margin-left: 501px; white-space: normal; line-height: 30.72px; text-align: right;\\\"><span style=\\\"font-family: 宋体; font-size: 18px;\\\">上海车配龙国际汽车售后服务市场经营管理股份有限公司董事会</span></p><p style=\\\"white-space: normal; line-height: 1px;\\\"><span style=\\\"font-family: &quot;Times New Roman&quot;;\\\">&nbsp;</span></p><p style=\\\"white-space: normal; text-align: right;\\\"><span style=\\\"font-family: 仿宋; font-size: 19px;\\\">2017&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px;\\\">年</span><span style=\\\"font-family: 仿宋; font-size: 19px;\\\">&nbsp;8&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px;\\\">月</span><span style=\\\"font-family: 仿宋; font-size: 19px;\\\">&nbsp;1&nbsp;</span><span style=\\\"font-family: 宋体; font-size: 19px;\\\">日</span></p><p style=\\\"white-space: normal;\\\"><strong><span style=\\\"font-family: 宋体; font-size: 24px;\\\"><br/></span></strong><br/></p><p><br/></p>', 9, 1, 1, 1, '', 0, '', 0, 1505712956, 1505712956, 1519794780);
